import React, {useState} from "react";
import axios from "axios";
import {serverPath} from "../App";
import {Logout} from "./HomePage";


export function SpecialSkills(props)
{
    return (<div className="card special-skill-item border-0">
        <div className="card-header bg-transparent border-0">
            <i className="icon ion-ios-star-outline"></i></div>
        <div className="card-body">
            <h3 className="card-title">Web Design</h3>
            <p className="card-text">Nullam id dolor id nibh ultricies vehicula ut id elit.
                Cras
                justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit
                non mi
                porta gravida at eget metus.</p>
        </div>
    </div>)
}


export class MainPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            description: "",
            user: "",
            username:props.username,
        }

        if(window.location.pathname !== "/" + this.state.username) {
            Logout();
             // window.location.href = "/login";
            // console.log(window.location.href, "and" ,window.location.pathname, "/" + props.username);
        }

        //if(this.state.user === "") {
            axios.post(serverPath + "/user/getDescription/", {username:this.state.username}).then(res => {
                this.state.user = res.data;
                if(res.data !== undefined) {
                    this.state.description = res.data.description;
                    // this.render();
                    document.getElementById("userDescription").innerHTML = this.state.description;
                }
                //this.setState({user: user});
            }).catch(err => {
                console.log(err);
            });
        // }
    }





    render() {

        // if(this.state.user !== undefined) {
        //     this.state.description = this.state.user.description;
        // }
        return (
            <div>
                <main className="page lanidng-page">
                    <section className="portfolio-block block-intro">
                        <div className="container">
                            <div className="avatar">
                                <img src="assets/img/avatars/avatar.jpg" alt="..."
                                     className="img-fluid rounded-circle"/>
                            </div>
                            <div className="about-me">
                                <p id={"userDescription"}>
                                    {
                                        ""
                                    }
                                </p>
                                <a className="btn btn-outline-primary" role="button" href="#">Hire me</a>
                            </div>
                        </div>
                    </section>
                    <section className="portfolio-block photography">
                        <div className="container">
                            <div className="row g-0">
                                <div className="col-md-6 col-lg-4 item zoom-on-hover"><a href="#"><img
                                    className="img-fluid image"
                                    src="assets/img/nature/image5.jpg"/></a>
                                </div>
                                <div className="col-md-6 col-lg-4 item zoom-on-hover"><a href="#"><img
                                    className="img-fluid image"
                                    src="assets/img/nature/image2.jpg"/></a>
                                </div>
                                <div className="col-md-6 col-lg-4 item zoom-on-hover"><a href="#"><img
                                    className="img-fluid image"
                                    src="assets/img/tech/image4.jpg"/></a>
                                </div>
                            </div>
                        </div>
                    </section>
                    <section className="portfolio-block skills">
                        <div className="container">
                            <div className="heading">
                                <h2>Special Skills</h2>
                            </div>
                            <div className="row">
                                <div className="col-md-4">

                                </div>
                                <div className="col-md-4">
                                    <div className="card special-skill-item border-0">
                                        <div className="card-header bg-transparent border-0">
                                            <i className="icon ion-ios-lightbulb-outline"></i></div>
                                        <div className="card-body">
                                            <h3 className="card-title">Interface Design</h3>
                                            <p className="card-text">Nullam id dolor id nibh ultricies vehicula ut id elit.
                                                Cras
                                                justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit
                                                non mi
                                                porta gravida at eget metus.</p>
                                        </div>
                                    </div>
                                </div>
                                <div className="col-md-4">
                                    <div className="card special-skill-item border-0">
                                        <div className="card-header bg-transparent border-0"><i
                                            className="icon ion-ios-gear-outline"></i></div>
                                        <div className="card-body">
                                            <h3 className="card-title">Photography and Print</h3>
                                            <p className="card-text">Nullam id dolor id nibh ultricies vehicula ut id elit.
                                                Cras
                                                justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit
                                                non mi
                                                porta gravida at eget metus.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </section>
                </main>
                <section className="portfolio-block website gradient">
                    <div className="container">
                        <div className="row align-items-center">
                            <div className="col-md-12 col-lg-5 offset-lg-1 text">
                                <h3>Website Project</h3>
                                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean eget velit ultricies,
                                    feugiat
                                    est sed, efr nunc, vivamus vel accumsan dui. Quisque ac dolor cursus, volutpat nisl
                                    vel,
                                    porttitor eros.</p>
                            </div>
                            <div className="col-md-12 col-lg-5">
                                <div className="portfolio-laptop-mockup">
                                    <div className="screen">
                                        <div className="screen-content">
                                            <img src={"assets/img/tech/image6.png"} alt="..."
                                                 className="img-fluid rounded-circle"/>
                                        </div>
                                    </div>
                                    <div className="keyboard"></div>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        );
    }
}
